import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          background: #FCF9E9;
        }
      `}</style>
        <Container>
            <Row>
                <Col md={6}>One of three columns</Col>
                <Col md={4}>One of three columns</Col>
            </Row>
        </Container>
    </div>
}
